import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";

const App=()=>{
const state = useState();
const [count,setCount]=useState(0);

const Clk=()=>{
  setCount(100)};
  return (
  <> 
  <div className="styl">
  <h1>{count}</h1>
  <button onClick={Clk} >click me</button>
  
  </div>
  </>
  )
  }


ReactDOM.render(
  <App />
 
  ,document.getElementById("root"));
